r_values])    \n        print(\"explained_variance ,singular_values: \", explained_variance.result(), \" and \" , singular_values.result(), flush=True)\nprint(\"Done in :\", time.perf_counter() - t, flush=True)\n\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1316","type":"AllLabels"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{},"id":"1320","type":"UnionRenderers"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{},"id":"1500","type":"UnionRenderers"},{"attributes":{},"id":"1318","type":"DatetimeTickFormatter"},{"attributes":{"data":{"bottom":[0,1,2,3,4,5,6,7,8,4,5,6,5,6,7,7,8,5,6,7,6,7,8,5,6,7,4,5,6,1,1,2,1,1,2],"color":["#64CB5D","#2E6C8E","#45BF6F","#45BF6F","#45BF6F","#45BF6F","#45BF6F","#45BF6F","#45BF6F","#3C4D8A","#472A79","#D7E219","#472A79","#3C4D8A","#3C4D8A","#472A79","#D7E219","#287A8E","#472A79","#D7E219","#287A8E","#472A79","#AFDC2E","#433C84","#472A79","#AFDC2E","#D7E219","#472A79","#88D547","#45BF6F","#287A8E","#1E978A","#1E978A","#64CB5D","#1E978A"],"filename":["","/ccc/work/cont003/gen2224/gen2224/spack/var/spack/environments/gysela-deisa-irene-skl-draft/.spack-env/view/lib/python3.9/site-packages/dask/optimization.py","/ccc/work/cont003/gen2224/gen2224/spack/var/spack/environments/gysela-deisa-irene-skl-draft/.spack-env/view/lib/python3.9/site-packages/dask/core.py","/ccc/work/cont003/gen2224/gen2224/spack/var/spack/environments/gysela-deisa-irene-skl-draft/.spack-env/view/lib/python3.9/site-packages/dask/core.py","/ccc/work/cont003/gen2224/gen2224/spack/var/spack/environments/gysela-deisa-irene-skl-draft/.spack-env/view/lib/python3.9/site-packages/dask/core.py","/ccc/work/cont003/gen2224/gen2224/spack/var/spack/environments/gys
